// SPDX-License-Identifier: MIT
pragma solidity >=0.7.0 <0.9.0;


contract Callee
{
    uint x;
    uint money;

    function setX(uint _x) public {
        x = _x;
    }

    function getX() public view returns (uint) {
        return x;
    }

    function transferMoney() public payable  {
        money = msg.value;
    }

    function getMoney() public view returns (uint){
        return money;
    }
}

contract Caller
{
    function setX(address caleeAddress, uint _x) public {
        Callee(caleeAddress).setX(_x);
    }

    function getX(address caleeAddress) public view returns (uint) {
        return Callee(caleeAddress).getX();
    }

    function transferMoney(address caleeAddress) external  payable  {
        Callee(caleeAddress).transferMoney();
    }

    function getMoney(address caleeAddress) public view returns (uint) {
        return Callee(caleeAddress).getMoney();
    }
}

